import{_ as t,c as e,o as a,a4 as r}from"./chunks/framework.DpC1ZpOZ.js";const m=JSON.parse('{"title":"《HelloGitHub》第 04 期","description":"","frontmatter":{},"headers":[],"relativePath":"HelloGitHub04.md","filePath":"HelloGitHub04.md"}'),i={name:"HelloGitHub04.md"},o=r('<h1 id="《hellogithub》第-04-期" tabindex="-1">《HelloGitHub》第 04 期 <a class="header-anchor" href="#《hellogithub》第-04-期" aria-label="Permalink to &quot;《HelloGitHub》第 04 期&quot;">​</a></h1><blockquote><p>兴趣是最好的老师，<strong>HelloGitHub</strong> 让你对编程感兴趣！</p></blockquote><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/cover.jpg" style="max-width:100%;"></p><h2 id="目录" tabindex="-1">目录 <a class="header-anchor" href="#目录" aria-label="Permalink to &quot;目录&quot;">​</a></h2><p>点击右上角的 <strong>「目录」</strong> 图标打开目录，获得更好的阅读体验。</p><p><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/catalog.png" alt=""></p><p><strong>Tips</strong>：如果遇到图片刷不出来的情况，<a href="https://hellogithub.com/periodical/volume/04" target="_blank" rel="noreferrer">点击</a> 换一种浏览方式。</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/weixin.png" style="max-width:30%;"><br> 关注「HelloGitHub」公众号，第一时间收到推送 </p><h2 id="内容" tabindex="-1">内容 <a class="header-anchor" href="#内容" aria-label="Permalink to &quot;内容&quot;">​</a></h2><blockquote><p><strong>以下为本期内容</strong>｜每个月 <strong>28</strong> 号更新</p></blockquote><h3 id="java-项目" tabindex="-1">Java 项目 <a class="header-anchor" href="#java-项目" aria-label="Permalink to &quot;Java 项目&quot;">​</a></h3><p>1、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/sohutv/cachecloud" target="_blank" rel="noreferrer">cachecloud</a>：搜狐视频开源的 CacheCloud 项目，提供了一个 Redis 云管理平台，功能强大，教程详细（有视频教程），文档齐全，<strong>企业级开源项目</strong></p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/04/50406544.png" style="max-width:80%;"></p><h3 id="javascript-项目" tabindex="-1">JavaScript 项目 <a class="header-anchor" href="#javascript-项目" aria-label="Permalink to &quot;JavaScript 项目&quot;">​</a></h3><p>2、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/yatessss/zhihudaily-vue" target="_blank" rel="noreferrer">zhihudaily-vue</a>：用 Vue.js 写的知乎日报手机 Web 版，需打开 chrome 浏览器的手机模拟功能，来获得比较好的浏览效果。访问展示图如下：</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/04/61360359.png" style="max-width:80%;"></p><p>3、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/zingchart/zingtouch" target="_blank" rel="noreferrer">zingtouch</a>：支持移动端各种触摸动作包含：转动、挥动、滑动等动作的库，<a href="https://zingchart.github.io/zingtouch/" target="_blank" rel="noreferrer">官方网站</a>，展示图如下：</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/04/53977537.gif" style="max-width:80%;"></p><h3 id="python-项目" tabindex="-1">Python 项目 <a class="header-anchor" href="#python-项目" aria-label="Permalink to &quot;Python 项目&quot;">​</a></h3><p>4、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/pallets-eco/flask-admin" target="_blank" rel="noreferrer">flask-admin</a>：我工作中需要写一个微型的管理系统，用的就是这个框架。简直快餐型，页面都写好了，只要设置好相关配置就可以跑起来了。唯一缺点就是文档中的例子少，开发一些特定的需求需要自己看源码，才能知道如何改。<a href="https://flask-admin.readthedocs.io/en/latest/" target="_blank" rel="noreferrer">文档</a>，下面是我跑起来之后的样子：</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/04/3758878.gif" style="max-width:80%;"></p><p>5、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/realpython/python-guide" target="_blank" rel="noreferrer">python-guide</a>：Requests 库的作者——kennethreitz，写的 Python 入门教程。不单单是语法层面的，涵盖项目结构、代码风格，进阶、工具等方方面面。虽然是<strong>英文版</strong>(<a href="http://pythonguidecn.readthedocs.io/zh/latest/" target="_blank" rel="noreferrer">中文翻译版</a>)，但我这个英语渣都能看懂，你肯定也可以，快去看看吧，开卷有益。<a href="http://docs.python-guide.org/en/latest/" target="_blank" rel="noreferrer">在线阅读</a></p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/04/1481305.jpg" style="max-width:80%;"></p><p>6、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/qiniu/python-sdk" target="_blank" rel="noreferrer">python-sdk</a>：七牛云存储 SDK。我自己在用他家的服务，上手简单、有免费额度，可以用来做‘图床’，同时，有了这个 SDK 可以写一些好用的小工具。<strong>注意</strong>：图床不能随便用，我曾经就用超了，账户的钱能扣成<strong>负数</strong>！</p><h3 id="其它" tabindex="-1">其它 <a class="header-anchor" href="#其它" aria-label="Permalink to &quot;其它&quot;">​</a></h3><p>7、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/JackyAndroid/AndroidInterview-Q-A" target="_blank" rel="noreferrer">AndroidInterview-Q-A</a>：这个项目主要是国内一线互联网公司的 Java 和 Android 方面的内部面试题。</p><p>8、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/jaywcjlove/awesome-mac" target="_blank" rel="noreferrer">awesome-mac</a>：排版相当好的一个 awesome 系列文章，文中介绍了很多 Mac 上好用的工具。</p><p>9、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/paddingme/Front-end-Web-Development-Interview-Question" target="_blank" rel="noreferrer">Front-end-Web-Development-Interview-Question</a>：前端开发面试题大收集</p><p>10、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/HIT-Alibaba/interview" target="_blank" rel="noreferrer">interview</a>：笔试面试知识整理(涵盖：IOS、Android、计算机基础)，<a href="https://hit-alibaba.github.io/interview/index.html" target="_blank" rel="noreferrer">在线阅读</a></p><p>11、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/taizilongxu/interview_python" target="_blank" rel="noreferrer">interview_python</a>：关于 Python 的面试题</p><p>12、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/mnielsen/neural-networks-and-deep-learning" target="_blank" rel="noreferrer">neural-networks-and-deep-learning</a>：《神经网络与深度学习》相关代码 Python 实现，<a href="https://tigerneil.gitbooks.io/neural-networks-and-deep-learning-zh/content/chapter1.html" target="_blank" rel="noreferrer">神经网络与深度学习－中文在线阅读</a>，该书中的相关理论的 Python 代码实现</p><p>13、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/MrKiven/PyZh" target="_blank" rel="noreferrer">PyZh</a>：Python 经典的技术文章的翻译和收集，<a href="http://pyzh.readthedocs.io/en/latest/" target="_blank" rel="noreferrer">在线阅读</a></p><p align="center"><a href="https://github.com/521xueweihan/HelloGitHub/blob/master/content/HelloGitHub03.md">『上一期』</a> | <a href="https://github.com/521xueweihan/HelloGitHub/issues/899">反馈和建议</a> | <a href="https://github.com/521xueweihan/HelloGitHub/blob/master/content/HelloGitHub05.md">『下一期』</a></p><hr><p align="center"> 👉 <a href="https://hellogithub.com/periodical">来！推荐开源项目</a> 👈<br> 微信中搜：<strong>HelloGitHub</strong> 关注公众号<br> 不仅能第一时间收到推送，还有回馈粉丝的活动<br> 如果文中的图刷不出来，可以点击 <a href="https://hellogithub.com/periodical/volume/04">这里</a>。 </p><h2 id="赞助" tabindex="-1">赞助 <a class="header-anchor" href="#赞助" aria-label="Permalink to &quot;赞助&quot;">​</a></h2><table><thead><tr><th align="center" style="width:80px;"><a href="https://www.ucloud.cn/site/active/kuaijiesale.html?utm_term=logo&amp;utm_campaign=hellogithub&amp;utm_source=otherdsp&amp;utm_medium=display&amp;ytag=github_hellogithub_otherdsp_display"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/ucloud.png" width="60px"><br><sub>UCloud</sub><br><sub>超值的全球云服务</sub></a></th><th align="center" style="width:80px;"><a href="https://www.upyun.com/"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/upyun.png" width="60px"><br><sub>CDN</sub><br><sub>开启全网加速</sub></a></th><th align="center" style="width:80px;"><a href="https://github.com/OpenIMSDK/Open-IM-Server"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/im.png" width="60px"><br><sub>OpenIM</sub><br><sub>开源IM力争No.1</sub></a></th><th align="center" style="width:80px;"><a href="https://apifox.cn/a103hello"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/apifox.png" width="60px"><br><sub>Apifox</sub><br><sub>比 Postman 更强大</sub></a></th></tr></thead></table><h2 id="声明" tabindex="-1">声明 <a class="header-anchor" href="#声明" aria-label="Permalink to &quot;声明&quot;">​</a></h2><p><a rel="license" href="https://creativecommons.org/licenses/by-nc-nd/4.0/deed.zh"><img alt="知识共享许可协议" style="border-width:0;" src="https://licensebuttons.net/l/by-nc-nd/4.0/88x31.png"></a><br>本作品采用 <a rel="license" href="https://creativecommons.org/licenses/by-nc-nd/4.0/deed.zh">署名-非商业性使用-禁止演绎 4.0 国际</a> 进行许可。</p>',39),h=[o];function l(n,s,c,p,g,u){return a(),e("div",null,h)}const d=t(i,[["render",l]]);export{m as __pageData,d as default};
